Director JB Benna\'s inspirational film UltraMarathon Man: 50 Marathons - 50 States - 50 Days, features renowned endurance athlete and best selling author Dean Karnazes, in his attempt to run 50 marathons in 50 states in 50 consecutive days. A beautiful and epic journey across the United States, during which Dean pushes the limits of human endurance, inspiring thousands across the country to join him along the path while uniting people of all ages and abilities to take the next step. 
